import React from 'react';
import './Roadmap.css'

const Roadmap = () => {
    return (
        <div className='roadmap'>
            <img src="https://scontent.fdad3-4.fna.fbcdn.net/v/t1.15752-9/269972570_302835114975516_7959093078032909143_n.png?_nc_cat=101&ccb=1-5&_nc_sid=ae9488&_nc_ohc=dx1wiM5vt7cAX94dqHa&tn=u8Rpyi0cgrnYXSZX&_nc_ht=scontent.fdad3-4.fna&oh=03_AVIJQXCsv5HPc7Jh2Kc6t8Upyw5jaADmAz3OSxVxswIhzQ&oe=61FF26D5"
                alt="" />
        </div>
    );
}

export default Roadmap;
